import {getEmployeeList} from '@/api/employee'

export default  {
  //模型数据
  data() {
    return {
      name: '', //员工姓名，对应上面的输入框
      page: 1,
      pageSize: 10,
      total: 0,
      records: []
    }
  },

  methods: {
    //分页查询
    pageQuery() {
      //准备请求的参数
      const params = {name: this.name, page: this.page, pageSize: this.pageSize}

      //发送ajax请求，访问后端服务，获取分页数据
      getEmployeeList(params)
    }
  }  
}
